function App() {

  var chatList = [
    "Chat 1",
    "Chat 2",
    "Chat 3",
  ];

  return (
    <div className="app-container">
      <div className="app-content">
        <SidePanel list={chatList}/>

        <ChatContent onSubmit={() => {
          console.log("Message envoyé");
        }}/>
      </div>
    </div>
  );
}

export default App;
